import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('Li Alinur Ruposhi Unicode Light-normal.ttf', font);
this.addFont('Li Alinur Ruposhi Unicode Light-normal.ttf', 'Li Alinur Ruposhi Unicode Light', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
